import logo from './logo.svg';
import './App.css';
import MainNavbar from './component/navbar/MainNavbar';

function App() {
  return (
    <Header
      title="kweekstop"
      kweekstop="kweekstop"
      products="Products"
      aboutUs="About Us"
      signUp="Sign up"
      categoriesProps={headerData.categoriesProps}
      loginPage={headerData.loginProps}
    />
  );
}

export default App;

function Header(props) {
  const { title, kweekstop, products, aboutUs, signUp, categoriesProps, loginProps } = props;

  return (
    <header className='header'>
      <div className='overlap-group2'>
        <h1 className='title valign-text-middle inter-bold-my-sin-40px'>
          {title}
        </h1>
        <div className='kweekstop valign-text-middle inter-bold-white-40px'>
          {kweekstop}
        </div>
      </div>
      <div className='overlap-group4'>
        <Categories categories={categoriesProps.categories} />
        <div className='products valign-text-middle inter-medium-mine-shaft-21px'>
          {products}
        </div>
        <div className='about-us valign-text-middle inter-medium-mine-shaft-21px'>
          {aboutUs}
        </div>
        <Search />
      </div>
      <CartNotification />
      <Login>{loginProps.children}</Login>
      <div className='overlap-group'>
        <div className='sign-up valign-text-middle'>
          {signUp}
        </div>
      </div>
    </header>
  );
}

function Categories(props) {
  const { categories } = props;

  return (
    <div className='categories'>
      <div className='overlap-group1'>
        <div className='categories-1 valign-text-middle inter-medium-mine-shaft-21px'>
          {categories}
        </div>
        <img className='chevron-down' src='chevron-down.svg' alt='chevron-down' />
      </div>
    </div>
  );
}

function Search() {
  return (
    <div className='search'>
      <div className='search-container'>
        <div className='search-here valign-text-middle inter-normal-mine-shaft-21px'>
          Search here
        </div>
        <div className='search-icon'>
          <img className='icon-search' src='search.svg' alt='icon-search' />
        </div>
      </div>
    </div>
  );
}

function CartNotification() {
  return (
    <div className='cart-notification'>
      <img className='icon-cart' src='shopping-cart.svg' alt='icon-cart' />
    </div>
  );
}

function Login(props) {
  const { children } = props;

  return (
    <div className='login'>
      <div className='log-in valign-text-middle'>
        {children}
      </div>
    </div>
  );
}

const categoriesData = {
  categories: "Categories",
};

const loginData = {
  children: "Log in",
}

const headerData = {
  title: "kweekstop",
  kweekstop: "kweekstop",
  products: "Products",
  aboutUs: "About Us",
  signUp: "Sign up",
  categoriesProps: categoriesData,
  loginProps: loginData,
};
